import { getBlack } from './../theme/colors';

const DetailsPanel = props => {
    class Year {
        constructor(year) {
            this.year = new Date();
            this.months = [
                'January',
                'February',
                'March',
                'April',
                'May',
                'June',
                'July',
                'August',
                'September',
                'October',
                'November',
                'December'
            ];
        }
    }

    const year = new Year(2020);
    console.log(year);
    return (
        <section className="details-panel">
            <h2 className="dropdown-title-selector">Months</h2>
            <section className="months-container">

            </section>
            <style jsx>{`
                .details-panel {
                    padding: 20px;
                    background: white;
                    grid-area: details;
                    border-radius: 10px;
                }
                .details-panel h2 {
                    color: ${getBlack(0.8)};
                }
            `}</style>
        </section>
    )
}

export default DetailsPanel;
